#[doc = "<span class=\"stab unstable\">[Experimental]</span> This domain provides various functionality related to drawing atop the inspected page.\n\n# Overlay\n\n## Commands\n\n- [`Overlay.enable`](struct.EnableCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Enables domain notifications.\n- [`Overlay.disable`](struct.DisableCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Disables domain notifications.\n- [`Overlay.setShowPaintRects`](struct.SetShowPaintRectsCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Requests that backend shows paint rectangles\n- [`Overlay.setShowDebugBorders`](struct.SetShowDebugBordersCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Requests that backend shows debug borders on layers\n- [`Overlay.setShowFPSCounter`](struct.SetShowFpsCounterCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Requests that backend shows the FPS counter\n- [`Overlay.setShowScrollBottleneckRects`](struct.SetShowScrollBottleneckRectsCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Requests that backend shows scroll bottleneck rects\n- [`Overlay.setShowViewportSizeOnResize`](struct.SetShowViewportSizeOnResizeCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Paints viewport size upon main frame resize.\n- [`Overlay.setPausedInDebuggerMessage`](struct.SetPausedInDebuggerMessageCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n- [`Overlay.setSuspended`](struct.SetSuspendedCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n- [`Overlay.setInspectMode`](struct.SetInspectModeCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Enters the 'inspect' mode. In this mode, elements that user is hovering over are highlighted. Backend then generates 'inspectNodeRequested' event upon element selection.\n- [`Overlay.highlightRect`](struct.HighlightRectCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Highlights given rectangle. Coordinates are absolute with respect to the main frame viewport.\n- [`Overlay.highlightQuad`](struct.HighlightQuadCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Highlights given quad. Coordinates are absolute with respect to the main frame viewport.\n- [`Overlay.highlightNode`](struct.HighlightNodeCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Highlights DOM node with given id or with the given JavaScript object wrapper. Either nodeId or objectId must be specified.\n- [`Overlay.highlightFrame`](struct.HighlightFrameCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Highlights owner element of the frame with given id.\n- [`Overlay.hideHighlight`](struct.HideHighlightCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Hides any highlight.\n- [`Overlay.getHighlightObjectForTest`](struct.GetHighlightObjectForTestCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  For testing.\n\n## Events\n\n- [`Overlay.nodeHighlightRequested`](struct.NodeHighlightRequestedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when the node should be highlighted. This happens after call to <code>setInspectMode</code>.\n- [`Overlay.inspectNodeRequested`](struct.InspectNodeRequestedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when the node should be inspected. This happens after call to <code>setInspectMode</code> or when user manually inspects an element.\n- [`Overlay.screenshotRequested`](struct.ScreenshotRequestedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when user asks to capture screenshot of some area on the page.\n\n##Types\n\n- [`HighlightConfig`](struct.HighlightConfig.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Configuration data for the highlighting of page elements.\n- [`InspectMode`](enum.InspectMode.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n"]
