#[doc = "This domain emulates different environments for the page.\n\n# Emulation\n\n## Commands\n\n- [`Emulation.setDeviceMetricsOverride`](struct.SetDeviceMetricsOverrideCommand.html)\n\n  Overrides the values of device screen dimensions \\(window.screen.width, window.screen.height, window.innerWidth, window.innerHeight, and \"device-width\"/\"device-height\"-related CSS media query results\\).\n- [`Emulation.clearDeviceMetricsOverride`](struct.ClearDeviceMetricsOverrideCommand.html)\n\n  Clears the overriden device metrics.\n- [`Emulation.resetPageScaleFactor`](struct.ResetPageScaleFactorCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Requests that page scale factor is reset to initial values.\n- [`Emulation.setPageScaleFactor`](struct.SetPageScaleFactorCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Sets a specified page scale factor.\n- [`Emulation.setVisibleSize`](struct.SetVisibleSizeCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span> <span class=\"stab deprecated\" style=\"display: inline-block\">[Deprecated]</span>\n\n  Resizes the frame/viewport of the page. Note that this does not affect the frame's container \\(e.g. browser window\\). Can be used to produce screenshots of the specified size. Not supported on Android.\n- [`Emulation.setScriptExecutionDisabled`](struct.SetScriptExecutionDisabledCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Switches script execution in the page.\n- [`Emulation.setGeolocationOverride`](struct.SetGeolocationOverrideCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Overrides the Geolocation Position or Error. Omitting any of the parameters emulates position unavailable.\n- [`Emulation.clearGeolocationOverride`](struct.ClearGeolocationOverrideCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Clears the overriden Geolocation Position and Error.\n- [`Emulation.setTouchEmulationEnabled`](struct.SetTouchEmulationEnabledCommand.html)\n\n  Enables touch on platforms which do not support them.\n- [`Emulation.setEmitTouchEventsForMouse`](struct.SetEmitTouchEventsForMouseCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n- [`Emulation.setEmulatedMedia`](struct.SetEmulatedMediaCommand.html)\n\n  Emulates the given media for CSS media queries.\n- [`Emulation.setCPUThrottlingRate`](struct.SetCpuThrottlingRateCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Enables CPU throttling to emulate slow CPUs.\n- [`Emulation.canEmulate`](struct.CanEmulateCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Tells whether emulation is supported.\n- [`Emulation.setVirtualTimePolicy`](struct.SetVirtualTimePolicyCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Turns on virtual time for all frames \\(replacing real-time with a synthetic time source\\) and sets the current virtual time policy.  Note this supersedes any previous time budget.\n- [`Emulation.setDefaultBackgroundColorOverride`](struct.SetDefaultBackgroundColorOverrideCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Sets or clears an override of the default background color of the frame. This override is used if the content does not specify one.\n\n## Events\n\n- [`Emulation.virtualTimeBudgetExpired`](struct.VirtualTimeBudgetExpiredEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Notification sent after the virtual time budget for the current VirtualTimePolicy has run out.\n- [`Emulation.virtualTimePaused`](struct.VirtualTimePausedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Notification sent after the virtual time has paused.\n\n##Types\n\n- [`ScreenOrientation`](struct.ScreenOrientation.html)\n\n  Screen orientation.\n- [`VirtualTimePolicy`](enum.VirtualTimePolicy.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  advance: If the scheduler runs out of immediate work, the virtual time base may fast forward to allow the next delayed task \\(if any\\) to run; pause: The virtual time base may not advance; pauseIfNetworkFetchesPending: The virtual time base may not advance if there are any pending resource fetches.\n"]
