#[doc = "Network domain allows tracking network activities of the page. It exposes information about http, file, data and other requests and responses, their headers, bodies, timing, etc.\n\n# Network\n\n## Commands\n\n- [`Network.enable`](struct.EnableCommand.html)\n\n  Enables network tracking, network events will now be delivered to the client.\n- [`Network.disable`](struct.DisableCommand.html)\n\n  Disables network tracking, prevents network events from being sent to the client.\n- [`Network.setUserAgentOverride`](struct.SetUserAgentOverrideCommand.html)\n\n  Allows overriding user agent with the given string.\n- [`Network.setExtraHTTPHeaders`](struct.SetExtraHttpHeadersCommand.html)\n\n  Specifies whether to always send extra HTTP headers with the requests from this page.\n- [`Network.getResponseBody`](struct.GetResponseBodyCommand.html)\n\n  Returns content served for the given request.\n- [`Network.setBlockedURLs`](struct.SetBlockedUrLsCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Blocks URLs from loading.\n- [`Network.replayXHR`](struct.ReplayXhrCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  This method sends a new XMLHttpRequest which is identical to the original one. The following parameters should be identical: method, url, async, request body, extra headers, withCredentials attribute, user, password.\n- [`Network.canClearBrowserCache`](struct.CanClearBrowserCacheCommand.html)\n\n  Tells whether clearing browser cache is supported.\n- [`Network.clearBrowserCache`](struct.ClearBrowserCacheCommand.html)\n\n  Clears browser cache.\n- [`Network.canClearBrowserCookies`](struct.CanClearBrowserCookiesCommand.html)\n\n  Tells whether clearing browser cookies is supported.\n- [`Network.clearBrowserCookies`](struct.ClearBrowserCookiesCommand.html)\n\n  Clears browser cookies.\n- [`Network.getCookies`](struct.GetCookiesCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Returns all browser cookies for the current URL. Depending on the backend support, will return detailed cookie information in the <code>cookies</code> field.\n- [`Network.getAllCookies`](struct.GetAllCookiesCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Returns all browser cookies. Depending on the backend support, will return detailed cookie information in the <code>cookies</code> field.\n- [`Network.deleteCookies`](struct.DeleteCookiesCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Deletes browser cookies with matching name and url or domain/path pair.\n- [`Network.setCookie`](struct.SetCookieCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Sets a cookie with the given cookie data; may overwrite equivalent cookies if they exist.\n- [`Network.setCookies`](struct.SetCookiesCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Sets given cookies.\n- [`Network.canEmulateNetworkConditions`](struct.CanEmulateNetworkConditionsCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Tells whether emulation of network conditions is supported.\n- [`Network.emulateNetworkConditions`](struct.EmulateNetworkConditionsCommand.html)\n\n  Activates emulation of network conditions.\n- [`Network.setCacheDisabled`](struct.SetCacheDisabledCommand.html)\n\n  Toggles ignoring cache for each request. If <code>true</code>, cache will not be used.\n- [`Network.setBypassServiceWorker`](struct.SetBypassServiceWorkerCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Toggles ignoring of service worker for each request.\n- [`Network.setDataSizeLimitsForTest`](struct.SetDataSizeLimitsForTestCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  For testing.\n- [`Network.getCertificate`](struct.GetCertificateCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Returns the DER-encoded certificate.\n- [`Network.setRequestInterceptionEnabled`](struct.SetRequestInterceptionEnabledCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Sets the requests to intercept that match a the provided patterns.\n- [`Network.continueInterceptedRequest`](struct.ContinueInterceptedRequestCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Response to Network.requestIntercepted which either modifies the request to continue with any modifications, or blocks it, or completes it with the provided response bytes. If a network fetch occurs as a result which encounters a redirect an additional Network.requestIntercepted event will be sent with the same InterceptionId.\n\n## Events\n\n- [`Network.resourceChangedPriority`](struct.ResourceChangedPriorityEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when resource loading priority is changed\n- [`Network.requestWillBeSent`](struct.RequestWillBeSentEvent.html)\n\n  Fired when page is about to send HTTP request.\n- [`Network.requestServedFromCache`](struct.RequestServedFromCacheEvent.html)\n\n  Fired if request ended up loading from cache.\n- [`Network.responseReceived`](struct.ResponseReceivedEvent.html)\n\n  Fired when HTTP response is available.\n- [`Network.dataReceived`](struct.DataReceivedEvent.html)\n\n  Fired when data chunk was received over the network.\n- [`Network.loadingFinished`](struct.LoadingFinishedEvent.html)\n\n  Fired when HTTP request has finished loading.\n- [`Network.loadingFailed`](struct.LoadingFailedEvent.html)\n\n  Fired when HTTP request has failed to load.\n- [`Network.webSocketWillSendHandshakeRequest`](struct.WebSocketWillSendHandshakeRequestEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when WebSocket is about to initiate handshake.\n- [`Network.webSocketHandshakeResponseReceived`](struct.WebSocketHandshakeResponseReceivedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when WebSocket handshake response becomes available.\n- [`Network.webSocketCreated`](struct.WebSocketCreatedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired upon WebSocket creation.\n- [`Network.webSocketClosed`](struct.WebSocketClosedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when WebSocket is closed.\n- [`Network.webSocketFrameReceived`](struct.WebSocketFrameReceivedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when WebSocket frame is received.\n- [`Network.webSocketFrameError`](struct.WebSocketFrameErrorEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when WebSocket frame error occurs.\n- [`Network.webSocketFrameSent`](struct.WebSocketFrameSentEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when WebSocket frame is sent.\n- [`Network.eventSourceMessageReceived`](struct.EventSourceMessageReceivedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when EventSource message is received.\n- [`Network.requestIntercepted`](struct.RequestInterceptedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Details of an intercepted HTTP request, which must be either allowed, blocked, modified or mocked.\n\n##Types\n\n- [`LoaderId`](type.LoaderId.html)\n\n  Unique loader identifier.\n- [`RequestId`](type.RequestId.html)\n\n  Unique request identifier.\n- [`InterceptionId`](type.InterceptionId.html)\n\n  Unique intercepted request identifier.\n- [`ErrorReason`](enum.ErrorReason.html)\n\n  Network level fetch failure reason.\n- [`TimeSinceEpoch`](type.TimeSinceEpoch.html)\n\n  UTC time in seconds, counted from January 1, 1970.\n- [`MonotonicTime`](type.MonotonicTime.html)\n\n  Monotonically increasing time in seconds since an arbitrary point in the past.\n- [`Headers`](struct.Headers.html)\n\n  Request / response headers as keys / values of JSON object.\n- [`ConnectionType`](enum.ConnectionType.html)\n\n  Loading priority of a resource request.\n- [`CookieSameSite`](enum.CookieSameSite.html)\n\n  Represents the cookie's 'SameSite' status: https://tools.ietf.org/html/draft-west-first-party-cookies\n- [`ResourceTiming`](struct.ResourceTiming.html)\n\n  Timing information for the request.\n- [`ResourcePriority`](enum.ResourcePriority.html)\n\n  Loading priority of a resource request.\n- [`Request`](struct.Request.html)\n\n  HTTP request data.\n- [`SignedCertificateTimestamp`](struct.SignedCertificateTimestamp.html)\n\n  Details of a signed certificate timestamp \\(SCT\\).\n- [`SecurityDetails`](struct.SecurityDetails.html)\n\n  Security details about a request.\n- [`BlockedReason`](enum.BlockedReason.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  The reason why request was blocked.\n- [`Response`](struct.Response.html)\n\n  HTTP response data.\n- [`WebSocketRequest`](struct.WebSocketRequest.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  WebSocket request data.\n- [`WebSocketResponse`](struct.WebSocketResponse.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  WebSocket response data.\n- [`WebSocketFrame`](struct.WebSocketFrame.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  WebSocket frame data.\n- [`CachedResource`](struct.CachedResource.html)\n\n  Information about the cached resource.\n- [`Initiator`](struct.Initiator.html)\n\n  Information about the request initiator.\n- [`Cookie`](struct.Cookie.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Cookie object\n- [`CookieParam`](struct.CookieParam.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Cookie parameter object\n- [`AuthChallenge`](struct.AuthChallenge.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Authorization challenge for HTTP status code 401 or 407.\n- [`AuthChallengeResponse`](struct.AuthChallengeResponse.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Response to an AuthChallenge.\n"]
