#[doc = "This domain exposes DOM read/write operations. Each DOM Node is represented with its mirror object that has an <code>id</code>. This <code>id</code> can be used to get additional information on the Node, resolve it into the JavaScript object wrapper, etc. It is important that client receives DOM events only for the nodes that are known to the client. Backend keeps track of the nodes that were sent to the client and never sends the same node twice. It is client's responsibility to collect information about the nodes that were sent to the client.<p>Note that <code>iframe</code> owner elements will return corresponding document elements as their child nodes.</p>\n\n# DOM\n\n## Commands\n\n- [`DOM.enable`](struct.EnableCommand.html)\n\n  Enables DOM agent for the given page.\n- [`DOM.disable`](struct.DisableCommand.html)\n\n  Disables DOM agent for the given page.\n- [`DOM.getDocument`](struct.GetDocumentCommand.html)\n\n  Returns the root DOM node \\(and optionally the subtree\\) to the caller.\n- [`DOM.getFlattenedDocument`](struct.GetFlattenedDocumentCommand.html)\n\n  Returns the root DOM node \\(and optionally the subtree\\) to the caller.\n- [`DOM.collectClassNamesFromSubtree`](struct.CollectClassNamesFromSubtreeCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Collects class names for the node with given id and all of it's child nodes.\n- [`DOM.requestChildNodes`](struct.RequestChildNodesCommand.html)\n\n  Requests that children of the node with given id are returned to the caller in form of <code>setChildNodes</code> events where not only immediate children are retrieved, but all children down to the specified depth.\n- [`DOM.querySelector`](struct.QuerySelectorCommand.html)\n\n  Executes <code>querySelector</code> on a given node.\n- [`DOM.querySelectorAll`](struct.QuerySelectorAllCommand.html)\n\n  Executes <code>querySelectorAll</code> on a given node.\n- [`DOM.setNodeName`](struct.SetNodeNameCommand.html)\n\n  Sets node name for a node with given id.\n- [`DOM.setNodeValue`](struct.SetNodeValueCommand.html)\n\n  Sets node value for a node with given id.\n- [`DOM.removeNode`](struct.RemoveNodeCommand.html)\n\n  Removes node with given id.\n- [`DOM.setAttributeValue`](struct.SetAttributeValueCommand.html)\n\n  Sets attribute for an element with given id.\n- [`DOM.setAttributesAsText`](struct.SetAttributesAsTextCommand.html)\n\n  Sets attributes on element with given id. This method is useful when user edits some existing attribute value and types in several attribute name/value pairs.\n- [`DOM.removeAttribute`](struct.RemoveAttributeCommand.html)\n\n  Removes attribute with given name from an element with given id.\n- [`DOM.getOuterHTML`](struct.GetOuterHtmlCommand.html)\n\n  Returns node's HTML markup.\n- [`DOM.setOuterHTML`](struct.SetOuterHtmlCommand.html)\n\n  Sets node HTML markup, returns new node id.\n- [`DOM.performSearch`](struct.PerformSearchCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Searches for a given string in the DOM tree. Use <code>getSearchResults</code> to access search results or <code>cancelSearch</code> to end this search session.\n- [`DOM.getSearchResults`](struct.GetSearchResultsCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Returns search results from given <code>fromIndex</code> to given <code>toIndex</code> from the sarch with the given identifier.\n- [`DOM.discardSearchResults`](struct.DiscardSearchResultsCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Discards search results from the session with the given id. <code>getSearchResults</code> should no longer be called for that search.\n- [`DOM.requestNode`](struct.RequestNodeCommand.html)\n\n  Requests that the node is sent to the caller given the JavaScript node object reference. All nodes that form the path from the node to the root are also sent to the client as a series of <code>setChildNodes</code> notifications.\n- [`DOM.highlightRect`](struct.HighlightRectCommand.html)\n\n  Highlights given rectangle.\n- [`DOM.highlightNode`](struct.HighlightNodeCommand.html)\n\n  Highlights DOM node.\n- [`DOM.hideHighlight`](struct.HideHighlightCommand.html)\n\n  Hides any highlight.\n- [`DOM.pushNodeByPathToFrontend`](struct.PushNodeByPathToFrontendCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Requests that the node is sent to the caller given its path. // FIXME, use XPath\n- [`DOM.pushNodesByBackendIdsToFrontend`](struct.PushNodesByBackendIdsToFrontendCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Requests that a batch of nodes is sent to the caller given their backend node ids.\n- [`DOM.setInspectedNode`](struct.SetInspectedNodeCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Enables console to refer to the node with given id via $x \\(see Command Line API for more details $x functions\\).\n- [`DOM.resolveNode`](struct.ResolveNodeCommand.html)\n\n  Resolves the JavaScript node object for a given NodeId or BackendNodeId.\n- [`DOM.getAttributes`](struct.GetAttributesCommand.html)\n\n  Returns attributes for the specified node.\n- [`DOM.copyTo`](struct.CopyToCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Creates a deep copy of the specified node and places it into the target container before the given anchor.\n- [`DOM.moveTo`](struct.MoveToCommand.html)\n\n  Moves node into the new container, places it before the given anchor.\n- [`DOM.undo`](struct.UndoCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Undoes the last performed action.\n- [`DOM.redo`](struct.RedoCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Re-does the last undone action.\n- [`DOM.markUndoableState`](struct.MarkUndoableStateCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Marks last undoable state.\n- [`DOM.focus`](struct.FocusCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Focuses the given element.\n- [`DOM.setFileInputFiles`](struct.SetFileInputFilesCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Sets files for the given file input element.\n- [`DOM.getBoxModel`](struct.GetBoxModelCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Returns boxes for the currently selected nodes.\n- [`DOM.getNodeForLocation`](struct.GetNodeForLocationCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Returns node id at given location.\n- [`DOM.getRelayoutBoundary`](struct.GetRelayoutBoundaryCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Returns the id of the nearest ancestor that is a relayout boundary.\n- [`DOM.describeNode`](struct.DescribeNodeCommand.html)\n\n  Describes node given its id, does not require domain to be enabled. Does not start tracking any objects, can be used for automation.\n\n## Events\n\n- [`DOM.documentUpdated`](struct.DocumentUpdatedEvent.html)\n\n  Fired when <code>Document</code> has been totally updated. Node ids are no longer valid.\n- [`DOM.setChildNodes`](struct.SetChildNodesEvent.html)\n\n  Fired when backend wants to provide client with the missing DOM structure. This happens upon most of the calls requesting node ids.\n- [`DOM.attributeModified`](struct.AttributeModifiedEvent.html)\n\n  Fired when <code>Element</code>'s attribute is modified.\n- [`DOM.attributeRemoved`](struct.AttributeRemovedEvent.html)\n\n  Fired when <code>Element</code>'s attribute is removed.\n- [`DOM.inlineStyleInvalidated`](struct.InlineStyleInvalidatedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Fired when <code>Element</code>'s inline style is modified via a CSS property modification.\n- [`DOM.characterDataModified`](struct.CharacterDataModifiedEvent.html)\n\n  Mirrors <code>DOMCharacterDataModified</code> event.\n- [`DOM.childNodeCountUpdated`](struct.ChildNodeCountUpdatedEvent.html)\n\n  Fired when <code>Container</code>'s child node count has changed.\n- [`DOM.childNodeInserted`](struct.ChildNodeInsertedEvent.html)\n\n  Mirrors <code>DOMNodeInserted</code> event.\n- [`DOM.childNodeRemoved`](struct.ChildNodeRemovedEvent.html)\n\n  Mirrors <code>DOMNodeRemoved</code> event.\n- [`DOM.shadowRootPushed`](struct.ShadowRootPushedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Called when shadow root is pushed into the element.\n- [`DOM.shadowRootPopped`](struct.ShadowRootPoppedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Called when shadow root is popped from the element.\n- [`DOM.pseudoElementAdded`](struct.PseudoElementAddedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Called when a pseudo element is added to an element.\n- [`DOM.pseudoElementRemoved`](struct.PseudoElementRemovedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Called when a pseudo element is removed from an element.\n- [`DOM.distributedNodesUpdated`](struct.DistributedNodesUpdatedEvent.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Called when distrubution is changed.\n\n##Types\n\n- [`NodeId`](type.NodeId.html)\n\n  Unique DOM node identifier.\n- [`BackendNodeId`](type.BackendNodeId.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Unique DOM node identifier used to reference a node that may not have been pushed to the front-end.\n- [`BackendNode`](struct.BackendNode.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Backend node with a friendly name.\n- [`PseudoType`](enum.PseudoType.html)\n\n  Pseudo element type.\n- [`ShadowRootType`](enum.ShadowRootType.html)\n\n  Shadow root type.\n- [`Node`](struct.Node.html)\n\n  DOM interaction is implemented in terms of mirror objects that represent the actual DOM nodes. DOMNode is a base node mirror type.\n- [`RGBA`](struct.Rgba.html)\n\n  A structure holding an RGBA color.\n- [`Quad`](type.Quad.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  An array of quad vertices, x immediately followed by y for each point, points clock-wise.\n- [`BoxModel`](struct.BoxModel.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Box model.\n- [`ShapeOutsideInfo`](struct.ShapeOutsideInfo.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  CSS Shape Outside details.\n- [`Rect`](struct.Rect.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Rectangle.\n"]
