#[doc = "Runtime domain exposes JavaScript runtime by means of remote evaluation and mirror objects. Evaluation results are returned as mirror object that expose object type, string representation and unique identifier that can be used for further object reference. Original objects are maintained in memory unless they are either explicitly released or are released along with the other objects in their object group.\n\n# Runtime\n\n## Commands\n\n- [`Runtime.evaluate`](struct.EvaluateCommand.html)\n\n  Evaluates expression on global object.\n- [`Runtime.awaitPromise`](struct.AwaitPromiseCommand.html)\n\n  Add handler to promise with given promise object id.\n- [`Runtime.callFunctionOn`](struct.CallFunctionOnCommand.html)\n\n  Calls function with given declaration on the given object. Object group of the result is inherited from the target object.\n- [`Runtime.getProperties`](struct.GetPropertiesCommand.html)\n\n  Returns properties of a given object. Object group of the result is inherited from the target object.\n- [`Runtime.releaseObject`](struct.ReleaseObjectCommand.html)\n\n  Releases remote object with given id.\n- [`Runtime.releaseObjectGroup`](struct.ReleaseObjectGroupCommand.html)\n\n  Releases all remote objects that belong to a given group.\n- [`Runtime.runIfWaitingForDebugger`](struct.RunIfWaitingForDebuggerCommand.html)\n\n  Tells inspected instance to run if it was waiting for debugger to attach.\n- [`Runtime.enable`](struct.EnableCommand.html)\n\n  Enables reporting of execution contexts creation by means of <code>executionContextCreated</code> event. When the reporting gets enabled the event will be sent immediately for each existing execution context.\n- [`Runtime.disable`](struct.DisableCommand.html)\n\n  Disables reporting of execution contexts creation.\n- [`Runtime.discardConsoleEntries`](struct.DiscardConsoleEntriesCommand.html)\n\n  Discards collected exceptions and console API calls.\n- [`Runtime.setCustomObjectFormatterEnabled`](struct.SetCustomObjectFormatterEnabledCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n- [`Runtime.compileScript`](struct.CompileScriptCommand.html)\n\n  Compiles expression.\n- [`Runtime.runScript`](struct.RunScriptCommand.html)\n\n  Runs script with given id in a given context.\n- [`Runtime.queryObjects`](struct.QueryObjectsCommand.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n## Events\n\n- [`Runtime.executionContextCreated`](struct.ExecutionContextCreatedEvent.html)\n\n  Issued when new execution context is created.\n- [`Runtime.executionContextDestroyed`](struct.ExecutionContextDestroyedEvent.html)\n\n  Issued when execution context is destroyed.\n- [`Runtime.executionContextsCleared`](struct.ExecutionContextsClearedEvent.html)\n\n  Issued when all executionContexts were cleared in browser\n- [`Runtime.exceptionThrown`](struct.ExceptionThrownEvent.html)\n\n  Issued when exception was thrown and unhandled.\n- [`Runtime.exceptionRevoked`](struct.ExceptionRevokedEvent.html)\n\n  Issued when unhandled exception was revoked.\n- [`Runtime.consoleAPICalled`](struct.ConsoleApiCalledEvent.html)\n\n  Issued when console API was called.\n- [`Runtime.inspectRequested`](struct.InspectRequestedEvent.html)\n\n  Issued when object should be inspected \\(for example, as a result of inspect\\(\\) command line API call\\).\n\n##Types\n\n- [`ScriptId`](type.ScriptId.html)\n\n  Unique script identifier.\n- [`RemoteObjectId`](type.RemoteObjectId.html)\n\n  Unique object identifier.\n- [`UnserializableValue`](enum.UnserializableValue.html)\n\n  Primitive value which cannot be JSON-stringified.\n- [`RemoteObject`](struct.RemoteObject.html)\n\n  Mirror object referencing original JavaScript object.\n- [`CustomPreview`](struct.CustomPreview.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n- [`ObjectPreview`](struct.ObjectPreview.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n\n  Object containing abbreviated remote object value.\n- [`PropertyPreview`](struct.PropertyPreview.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n- [`EntryPreview`](struct.EntryPreview.html) <span class=\"stab unstable\" style=\"display: inline-block\">Experimental</span>\n- [`PropertyDescriptor`](struct.PropertyDescriptor.html)\n\n  Object property descriptor.\n- [`InternalPropertyDescriptor`](struct.InternalPropertyDescriptor.html)\n\n  Object internal property descriptor. This property isn't normally visible in JavaScript code.\n- [`CallArgument`](struct.CallArgument.html)\n\n  Represents function call argument. Either remote object id <code>objectId</code>, primitive <code>value</code>, unserializable primitive value or neither of \\(for undefined\\) them should be specified.\n- [`ExecutionContextId`](type.ExecutionContextId.html)\n\n  Id of an execution context.\n- [`ExecutionContextDescription`](struct.ExecutionContextDescription.html)\n\n  Description of an isolated world.\n- [`ExceptionDetails`](struct.ExceptionDetails.html)\n\n  Detailed information about exception \\(or error\\) that was thrown during script compilation or execution.\n- [`Timestamp`](type.Timestamp.html)\n\n  Number of milliseconds since epoch.\n- [`CallFrame`](struct.CallFrame.html)\n\n  Stack entry for runtime errors and assertions.\n- [`StackTrace`](struct.StackTrace.html)\n\n  Call frames for assertions or error messages.\n"]
